return floor(
	difference(
		color(0x0000ffff,sphere({ r: 20, fn:100 })),
		translate([15, 0, 0], cube([20, 20, 20])),
		translate([0, 0, 15], cylinder({ r: 20, h: 30 , fn:100}))
	)
);
*/
//return cube([40, 50, 60]);


var b1= floor(
	translate([30,0,0],
		cube([5,5,5])
	)
);

var b2= floor(
	translate([0,0,0],
		cube([10,10,10])
	)
);

return {
	b1:b1,
	b2:b2,
};
//*/

return floor(
	translate([30,0,0],
		union(

			translate([5,5,0],
				color(0xffff0000, cube([10,10,10]))
			),
			translate([0,0,0],
				cube([10,10,10])
			)
		)
	)
);

